import React from 'react';
import PitchInputForm from './components/PitchInputForm';  // Import your PitchInputForm component
import SettingsPage from './components/SettingsPage';  // Import your SettingsPage component
import axios from 'axios';

const App = () => {
  return (
    <div>
      <h1>Baseball Pitch Grader</h1>
      <PitchInputForm />
      <SettingsPage />
    </div>
  );
}

const pitchMetrics = {
  velocity: 85,
  inducedVerticalBreak: 16,
  horizontalBreak: 9,
  spinRate: 2100,
  releaseHeight: 6.2,
  extension: 5.7,
  verticalApproachAngle: -5.3
};

const calculatePitchGrade = async () => {
  try {
    const response = await axios.post('http://localhost:5000/gradePitch', pitchMetrics);
    console.log('Pitch Grade:', response.data.pitchGrade);
  } catch (error) {
    console.error('Error calculating pitch grade:', error);
  }
};

// Call the function to calculate pitch grade
calculatePitchGrade();

export default App;
